window.bookSummaryJSON = "<p>They say you always want what you can't have....</p> <p>And in my tiny, upper-class town, everyone wants the Savage Six. Whether it’s to be them, beat them, or f--k them depends on who you ask.</p> <p>But for me…it’s Cole Callahan that I want.</p> <p>The Savage Society’s unofficial leader—and my dad’s best friend.</p> <p>He pretends I don’t exist, at least until my 18th birthday.</p> <p>That’s when everything changes, and this dangerous, ruthless man decides that I’m his.</p> <p>His to worship.<br> His to pleasure.<br> His to own.</p> <p>Cole’s got big plans for our future—permanent<i> </i>plans that he won’t let me say no to.</p> <p>But we’ve got bigger problems, as a new rival threatens the Savage Society and Cole’s position in it. War’s coming, and my hitman boyfriend’s about to learn what ‘til death do us part really means…</p> <p>This is a steamy dad's best friend, age gap dark romance with triggers and themes often found in these types of books. You can find a full list of trigger warnings at the start of the book.</p> <p>This audiobook narration is done in duet with the female narrator reading all female parts regardless of chapter POV, and the same for the male narrator.</p>"; 
